  computed: {
    ...mapState(["userInfo", "assetFormHeader"]),
    dataList() {
      let newArr = [];
      let arr = this.assetFormHeader.map((item) => {
        return {
          nameShow: item.nameShow,
          dbDataName: item.dbDataName,
        };
      });
      arr.forEach((el) => {
        if (
          el.dbDataName != "state" &&
          el.dbDataName != "photo" &&
          el.dbDataName != "file"
        ) {
          newArr.push(el);
        }
      });

      return newArr;
    },
  },
  methods: {
    // 请求标签
    getLabels() {
      this.loading = true;
      this.labelId = localStorage.getItem("assetTemaplateId");
      select({
        func: "S0019",
        userId: this.userInfo._id,
        token: this.userInfo.token,
        requstData: {
          type: 0,
        },
      })
        .then(({ data }) => {
          this.loading = false;
          if (data.code != 0) return this.$message.error(data.data);
          if (data.data && data.data.length) {
            if (!data.data.some((e) => e._id == this.labelId)) {
              this.labelId = data.data[0]._id;
              localStorage.setItem("assetTemaplateId", this.labelId);
            }
            this.labels = data.data;
            this.labelImages = [];
            data.data.forEach(async (e) => {
              if (e.html) {
                let element = document.createElement("div");
                element.style.position = "fixed";
                element.style.top = "-10000px";
                document.body.appendChild(element);
                let base64 = await dataToPrintImg(e, element, undefined);
                document.body.removeChild(element);
                this.labelImages.push({
                  _id: e._id,
                  base: base64,
                  title: e.name,
                  edit: true,
                });
              } else {
                let canvas = document.createElement("CANVAS");
                let tagItemInfo = await getCanvasTemplate(
                  e,
                  canvas,
                  undefined,
                  false
                );
                tagItemInfo._id = e._id;
                tagItemInfo.edit = e.false;
                this.labelImages.push(tagItemInfo);
              }
            });
          }
        })
        .catch(() => {
          this.loading = false;
          // "服务器网络异常，请求资产打印模版异常"
          this.$message.error(this.$t("h.tips18"));
        });
    },
    // 选中标签
    selectLabel(_id) {
      this.labelId = _id;
      localStorage.setItem("assetTemaplateId", _id);
    },
    // 添加标签
    addLabel() {
      this.customDialogVisible = true;
    },
    // 编辑标签
    editLabel(index) {
      this.labelItem = this.labels[index];
      this.customDialogVisible = true;
      this.step = true;
    },
    // 删除标签
    deleteLabel(_id) {
      if (_id == this.labelId) {
        return this.$notify.error({
          title: this.$t("h.title27"),
          message: this.$t("h.drawLabelComponents76"),
        });
      }
      if (_id <= 7) {
        return this.$notify.error({
          title: this.$t("h.title27"),
          message: this.$t("h.drawLabelComponents77"),
        });
      }
      this.$confirm(this.$t("h.drawLabelComponents78"), this.$t("h.title18"), {
        confirmButtonText: this.$t("h.confirmBtn"),
        cancelButtonText: this.$t("h.cancelBtn"),
        type: "warning",
      })
        .then(() => {
          this.loading = true;
          deleteData({
            func: "D0018",
            userId: this.userInfo._id,
            token: this.userInfo.token,
            requstData: {
              _id: _id,
              permissonId: 57,
            },
          })
            .then(({ data }) => {
              this.loading = false;
              if (data.code != 0) return this.$message.error(data.data);
              this.getLabels();
              this.$message.success(data.data);
            })
            .catch(() => {
              this.loading = false;
              // "服务器网络错误，删除打印资产模版失败"
              this.$message.error(this.$t("h.tips18"));
            });
        })
        .catch(() => {
          this.$message.info(this.$t("h.tips98"));
        });
    },
    // 新建/编辑弹窗关闭

    customDialogVisibleClosed() {
      this.labelItem = {};
      this.step = false;
    },
  },
  created() {
    this.getLabels();
  },
};
